import React from 'react';
import myLogo from '../assets/tb.png';
import { Navbar, Text } from "@nextui-org/react";
import Home from './Home.js'

function MyNavbar() {
  return (
    <div>
      <Navbar isBordered={true} variant={'sticky'} maxWidth={'lg'}>
        <Navbar.Brand>
          <img src={myLogo} height={'80px'} alt="!dev"/>
          <Text b color={'inherit'} hideIn={'xs'}>
            !dev
          </Text>
        </Navbar.Brand>
        <Navbar.Content hideIn={'xs'}>
          <Navbar.Link href='#'>Home</Navbar.Link>
          <Navbar.Link isActive href='#'>Projects</Navbar.Link>
          <Navbar.Link href='#'>About Me</Navbar.Link>
          <Navbar.Link href='#'>Contact Me</Navbar.Link>
        </Navbar.Content>
      </Navbar>
      <Home/>
    </div>
  );
}

export default MyNavbar;
